<?php

add_action( 'after_setup_theme', 'remove_parent_theme_banners', 15 );

function remove_parent_theme_banners() {

    // remove the parent [banner] shortcode
    remove_shortcode( 'ux_banner' );
    
    // add our [banner] shortcode
    add_shortcode( 'ux_banner', 'dunkbannerShortcode' );
}


// [dunk_banner]
function dunkbannerShortcode( $atts, $content = null ){
  $bannerid = rand();
  extract( shortcode_atts( array(
    'text_pos' => 'center',
    'height' => '300px',
    'text_color' => 'light',
    'link' => '',
    'text_width' => '60%',
    'text_align' => 'center',
    'text_box' => '',
    'animation' => 'fadeIn',
    'effect' => '',
    'hover' => '',
    'bg' => '', // Set default value
    'parallax' => '',
    'class' => ''
  ), $atts ) );

  ob_start();

  // replace ___ (3 underscores) with a nice divider
  $fix = array (
                '&nbsp;' => '', 
                '<p></p>' => '', 
                '<p>[' => '[', 
                ']</p>' => ']', 
                ']<br />' => ']',
                '_____' => '<div class="tx-div large"></div>',
                '____' => '<div class="tx-div medium"></div>',
                '___' => '<div class="tx-div small"></div>',
  );
   $content = strtr($content, $fix);

   $content = do_shortcode( $content ); 

   $img_link = get_template_directory_uri().'/img/';

   $color = "light";
   if($text_color == 'light') $color = "dark";

   if($hover) $hover = 'hover_'.$hover;

   $animated = "";
   if($animation != "none") $animated = "animated";

   $start_link = "";
   $end_link = "";
   if($link) {$start_link = '<a href="'.$link.'">'; $end_link = '</a>';};

   $background = "";
   $background_color = "";
    if (strpos($bg,'http://') !== false || strpos($bg,'https://') !== false) {
      $background = $bg;
    }
    elseif (strpos($bg,'#') !== false) {
      $background_color = 'background-color:'.$bg.'!important';
    }
     else {
      $bg = wp_get_attachment_image_src($bg, 'large');
      $background = $bg[0];
    }

   $textalign = "";
   if($text_align) {$textalign = "text-".$text_align;}
    
   $parallax_class = '';
   if($parallax){$parallax_class = 'ux_parallax'; $parallax='data-velocity="0.'.$parallax.'"';} 
 
  // user can set custom classes in shortcode by using $class from above
 	
  ?>
   <div id="banner_<?php echo $bannerid; ?>" class="ux_banner <?php if($text_box)echo 'ux-textbox-'.$text_box; ?> <?php echo $color; ?> <?php echo $hover; ?> <?php echo $class; ?>"  style="height:<?php echo $height; ?>" data-height="<?php echo $height; ?>" role="banner">
      <?php echo $start_link; ?>
       <div class="banner-bg <?php echo $parallax_class; ?>" <?php echo $parallax; ?> style="background-image:url(<?php echo $background; ?>); <?php echo $background_color; ?>">
       <?php // look for way to make it conditional on the mid slider before outputting grad image below ?>
       
       </div>
       <?php if($effect){ ?>
          <div class="banner-effect"></div>
       <?php } ?>
        <div class="row">
          <div class="inner <?php echo $text_pos; ?>  <?php echo $animated; ?>  <?php echo $textalign; ?> " data-animate="<?php echo $animation; ?>" style="width:<?php echo $text_width; ?>">
           <?php echo $content; ?>
          </div>  
        </div>
       <?php echo $end_link; ?>

<?php // EFFECTS // ?>

<?php if($effect === 'snow'){ ?>
